export class Usuario {
  constructor(id, username, email, vip, role, updatedAt, createdAt) {
    this.id = id;
    this.username = username;
    this.email = email;
    this.vip = vip;
    this.role = role;
    this.updatedAt = updatedAt;
    this.createdAt = createdAt;
  }

  getRole() {
    return this.role;
  }

  getVip() {
    return this.vip;
  }

  getCreatedAt() {
    return this.createdAt;
  }

  getUpdatedAt() {
    return this.updatedAt;
  }

  getUsername() {
    return this.username;
  }

  getEmail() {
    return this.email;
  }

  getId() {
    return this.id;
  }

  setId(id) {
    this.id = id;
  }

}
